pragma solidity 0.8.10;

library BespokeTypes {
    struct Offer {
        bool isProrated;
        uint256 reserveId;
        OfferType offerType;// move offerType field here so solve encode/decode issue
        address nftAddress;
        uint256 tokenId;
        uint256 tokenAmount; // 1 for ERC721, 1+ for ERC1155
        address signer; //borrower or lender
        uint256 borrowAmountMin;
        uint256 borrowAmountMax;
        uint40 borrowDurationMin;
        uint40 borrowDurationMax;
        uint128 borrowRate;
        address currency;
        uint256 nonce;
        uint256 deadline;
        address strategy;
        bytes params;
        uint8 v; // v: parameter (27 or 28)
        bytes32 r; // r: parameter
        bytes32 s; // s: parameter
    }

    enum OfferType {
        BORROW, // borrow offer
        SINGLE, // single
        COLLECTION, // offer to collection
        MULTIPLE, // many. only for ERC721
        ATTRIBUTE, // by attribute
        PRIVATE // private
    }

    // params for takeLendOffer
    struct LendOfferTakeParams {
        address taker;
        uint256 tokenId;
        bytes params;
    }

    struct validateTakeLendOfferParams {
        bytes32 offerHash;
        address underlyingSpecified;
        uint256 borrowAmount;
        uint256 borrowDuration;
        bytes32 domainSeparator;
        address bespokeSettings;
        address settings;
    }

    struct executeTakeLendParams {
        uint256 tokenId;
        uint256 borrowAmount; // new borrow amount
        uint256 borrowDuration; // new borrow duration
        address bespokeSettings;
        address settings;
        bytes32 domainSeparator;
//        bytes32 offerHash;
        bytes params;
    }

    struct executeTakeBorrowParams {
        uint256 amount;
        uint256 duration;
        address bespokeSettings;
        address settings;
        bytes32 domainSeparator;
        bytes32 offerHash;
    }

    // repayAmount?
    // adminFee
    struct LoanData {
        uint256 reserveId;
        address nftAddress;
        uint256 tokenId;
        uint256 tokenAmount; // 1 for ERC721, 1+ for ERC1155
        address nftManager;
        address borrower;
        address lender;
        uint256 amount;
        uint128 borrowRate;
        uint128 interestPerSecond;
        address currency;
        uint40 borrowDuration;
        uint40 borrowBegin;
        uint40 borrowOverdueTime;
        uint40 liquidatableTime;
        bool isProrated;
        LoanStatus status;
    }

    enum LoanStatus {
        NONE,
        BORROWING,
        OVERDUE,
        LIQUIDATABLE
    }

    struct WhitelistInfo {
        bool enabled;
        uint256 minBorrowDuration;
        uint256 maxBorrowDuration;
        uint256 overdueDuration;
    }

    struct executeRolloverParams {
        uint256 loanId;
        uint256 borrowAmount; // new borrow amount
        uint256 borrowDuration; // new borrow duration
        address bespokeSettings;
        address settings;
        bytes32 domainSeparator;
        bytes32 offerHash;
    }

    struct Counter {
        // This variable should never be directly accessed by users of the library: interactions must be restricted to
        // the library's function. As of Solidity v0.5.2, this cannot be enforced, though there is a proposal to add
        // this feature: see https://github.com/ethereum/solidity/issues/4637
        uint256 _value; // default: 0
    }
}
