pragma solidity 0.8.10;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol';

import {IAaveLendPoolAddressesProvider} from './interfaces/IAaveLendPoolAddressesProvider.sol';
import {IAaveLendPool} from './interfaces/IAaveLendPool.sol';

import {IAaveFlashLoanReceiver} from './interfaces/IAaveFlashLoanReceiver.sol';
import {IOpenSkyRefinance} from './IOpenSkyRefinance.sol';
import '../libraries/BespokeTypes.sol';
import '../../dependencies/weth/IWETH.sol';

import {IOpenSkyBespokeMarket} from '../interfaces/IOpenSkyBespokeMarket.sol';
import {IOpenSkyPool} from '../../interfaces/IOpenSkyPool.sol';

import 'hardhat/console.sol';

contract OpenSkyRefinance is IOpenSkyRefinance {
    using SafeERC20 for IERC20;

    IAaveLendPoolAddressesProvider public immutable AAVE2_ADDRESSES_PROVIDER;
    IOpenSkyBespokeMarket public immutable OpenSkyBespokeMarket;
    IOpenSkyPool public immutable OpenSkyPool;

    constructor(
        IAaveLendPoolAddressesProvider provider,
        IOpenSkyBespokeMarket bespokeMarket,
        IOpenSkyPool pool
    ) {
        AAVE2_ADDRESSES_PROVIDER = provider;
        OpenSkyBespokeMarket = bespokeMarket;
        OpenSkyPool = pool;
    }

    function aavePool() public returns (IAaveLendPool) {
        return IAaveLendPool(AAVE2_ADDRESSES_PROVIDER.getLendingPool());
    }

    // for future extensibility
    function refinance(
        address adapter,
        address flashBorrowAssetAddress,
        uint256 flashBorrowAmount,
        bytes calldata data
    ) public override {
        address[] memory assets = new address[](1);
        assets[0] = flashBorrowAssetAddress;
        uint256[] memory amounts = new uint256[](1);
        amounts[0] = flashBorrowAmount;
        uint256[] memory modes = new uint256[](1);
        modes[0] = 0;
        bytes memory params = abi.encode(data, msg.sender);
        aavePool().flashLoan(adapter, assets, amounts, modes, address(0), params, 0);
    }
}
